  `maap_token` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '身份鉴权时的随机码token',
  `chatbot_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '默认chatbot的id',
  `audit_instructions` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '审核说明',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT 'CURRENT_TIMESTAMP',
  `region_id` bigint(20) NULL DEFAULT 0 COMMENT 'MaaP的归属大区id',
  `flow_limit` int(11) NOT NULL DEFAULT 50 COMMENT '流量限制',
  `menu_button` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '底部按钮',
