INSERT INTO `i5gmc_msg_template` VALUES (192, 2, '智慧社区-园区信息', '智慧社区-园区信息', '{\"message\":{\"generalPurposeCard\":{\"layout\":{\"cardOrientation\":\"VERTICAL\",\"imageAlignment\":\"LEFT\",\"style\":\"https://5gmc.kefucloud.net/oss/download/thumbnail/255.css?bucket=i5gmcDev&name=255.css&type=null&contentType=text/css\"},\"content\":{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/1/2020/10/10/a0bdd01e-0c86-413e-b41e-61e92915fe95.png?bucket=i5gmcDev&name=%E5%9B%AD%E5%8C%BA%E4%BF%A1%E6%81%AF.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/1/2020/10/10/a0bdd01e-0c86-413e-b41e-61e92915fe95.png?bucket=i5gmcDev&name=%E5%9B%AD%E5%8C%BA%E4%BF%A1%E6%81%AF.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"园区信息\",\"description\":\"创写无数高品质地产作品的星河湾集团，秉承“舍得、用心、创新”理念，将承载南粤精神的建筑地标，铸造为中西交融的艺术结晶。内蕴东方艺术精髓，外显国际创新理念，建筑美学与人文涵养在此有机结合。以工匠精神诚现高品质超甲级写字楼新作。\\n\\n\\n\\n星河湾中心坐拥粤港澳大湾区——中国战略核心区域，商机繁盛、位越超然，升值潜力无限。\\n\\n星河湾中心，凝聚中国新时代精神，向未来诠新出发。融汇东方智慧的建筑形态， 筑构时代精神地标运用“天圆地方”东方智慧，彰显中华民族文化自信；融汇东西方建筑美学，展现功能与美学的精巧平衡；灵动流畅线条，从底部方形体型向上延展为圆形体型设计。\\n\\n\\n\\n刚柔并济，呈地标级建筑典范\\n\\n每一寸设计间展现绿色环保生态的建筑理念；\\n\\n实现传统与现代的有机结合，构筑成独一无二的精神地标。\\n\\n塔楼总高度250米，地上46层，总建筑面积约12万平方米；\\n\\n助推区域价值提升，彰显星河湾总部顶级地位。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://wb.amap.com/?p=B0GRLCOAKZ,23.100654751158764,113.34667146205902,%E6%98%9F%E6%B2%B3%E6%B9%BE%E4%B8%AD%E5%BF%83%28%E5%BB%BA%E8%AE%BE%E4%B8%AD%29,%E7%90%B6%E6%B4%B2%E5%A4%A7%E9%81%93168%E5%8F%B7\"}},\"displayText\":\"园区位置\",\"postback\":{\"data\":\"\"}}},{\"reply\":{\"displayText\":\"访客预约\",\"postback\":{\"data\":\"星河湾-访客预约\"}}}]}}}}', '{\"suggestions\":[]}', 2, 1, 2, 0, '2020-10-10 10:13:33', '', 32, 0, 0, 0, '');
