INSERT INTO `i5gmc_msg_template` VALUES (370, 3, '重庆日报-重庆新闻', '重庆日报-重庆新闻', '{\"message\":{\"generalPurposeCardCarousel\":{\"layout\":{\"cardWidth\":\"MEDIUM_WIDTH\",\"style\":\"https://5gmc.kefucloud.net/oss/download/thumbnail/255.css?bucket=i5gmcDev&name=255.css&type=null&contentType=text/css\"},\"content\":[{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/d942dc1a-0e12-47dd-a0c4-8c97854e8a00.png?bucket=i5gmcDev&name=%E7%BE%8E%E4%B8%BD%E4%B9%A1%E6%9D%91.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/d942dc1a-0e12-47dd-a0c4-8c97854e8a00.png?bucket=i5gmcDev&name=%E7%BE%8E%E4%B8%BD%E4%B9%A1%E6%9D%91.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\" 铜梁西郊绿道 美丽乡村的一条秀带\",\"description\":\"习近平总书记在去年底召开的中央农村工作会议上强调，全面实施乡村振兴战略的深度、广度、难度都不亚于脱贫攻坚，必须加强顶层设计，以更有力的举措、汇聚更强大的力量来推进。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://www.cqrb.cn/content/2021-02/23/content_304198.htm\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看原文\"}}]},{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/a3adbe90-5a63-416a-b2d0-c4557a5f9861.jpg?bucket=i5gmcDev&name=%E8%8B%97%E7%BB%A3%26amp%3Bldquo%3B%E7%BB%A3%26amp%3Brdquo%3B%E5%87%BA%E6%96%B0%E7%94%9F%E6%B4%BB.jpg&type=null&contentType=image/jpeg\",\"mediaContentType\":\"image/jpeg\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/a3adbe90-5a63-416a-b2d0-c4557a5f9861.jpg?bucket=i5gmcDev&name=%E8%8B%97%E7%BB%A3%26amp%3Bldquo%3B%E7%BB%A3%26amp%3Brdquo%3B%E5%87%BA%E6%96%B0%E7%94%9F%E6%B4%BB.jpg&type=null&contentType=image/jpeg\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"苗绣“绣”出新生活\",\"description\":\"2月20日，酉阳土家族苗族自治县车田乡小寨村风和日丽。在“酉州苗绣”非遗工坊扶贫车间的院坝内，谭小华正手持绣针穿针引线，在她的勾勒下，绣布上的红花栩栩如生。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://www.cqrb.cn/content/2021-02/24/content_304364.htm\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看原文\"}}]},{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/619768c8-1ea1-4cf7-943c-bd8336a22ac4.jpg?bucket=i5gmcDev&name=%E9%87%8D%E7%82%B9%E5%B7%A5%E7%A8%8B%E6%96%BD%E5%B7%A5%E5%BF%99.jpg&type=null&contentType=image/jpeg\",\"mediaContentType\":\"image/jpeg\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/619768c8-1ea1-4cf7-943c-bd8336a22ac4.jpg?bucket=i5gmcDev&name=%E9%87%8D%E7%82%B9%E5%B7%A5%E7%A8%8B%E6%96%BD%E5%B7%A5%E5%BF%99.jpg&type=null&contentType=image/jpeg\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\" 新春走基层|鼓足牛劲赶早春 重点工程施工忙\",\"description\":\"人勤春来早，奋进正当时。今年是建党100周年，也是“十四五”规划开局之年、开启全面建设社会主义现代化国家新征程的第一年。进入牛年以来，全市各区县、各企业践行新发展理念，构建新发展格局，推动高质量发展。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://www.cqrb.cn/content/2021-02/25/content_304541.htm\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看原文\"}}]}]}}}', '{\"suggestions\":[{\"reply\":{\"displayText\":\"返回首页\",\"postback\":{\"data\":\"重庆日报\"}}}]}', 2, 1, 2, 1, '2021-03-25 14:04:23', '', 60, 1, 0, 1, '{\"SMS_signature\":\"重庆日报\",\"text_content\":\"您有一条来自“重庆日报”的5G消息，当前手机不支持接收5G消息，您可进入以下链接预览消息内容。\",\"pic_url\":\"\",\"media_url\":\"\",\"h5_url\":\"http://14.23.86.58:8086/w/#/home?a=10682610003&t=368\"}');
INSERT INTO `i5gmc_msg_template` VALUES (371, 3, '重庆日报-重庆观察', '重庆日报-重庆观察', '{\"message\":{\"generalPurposeCardCarousel\":{\"layout\":{\"cardWidth\":\"MEDIUM_WIDTH\",\"style\":\"https://5gmc.kefucloud.net/oss/download/thumbnail/255.css?bucket=i5gmcDev&name=255.css&type=null&contentType=text/css\"},\"content\":[{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/2808afae-0de9-4fdc-ae7d-58f40416855e.png?bucket=i5gmcDev&name=%E4%B8%80%E5%BA%A7%E5%9F%8E%E5%B8%82.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/2808afae-0de9-4fdc-ae7d-58f40416855e.png?bucket=i5gmcDev&name=%E4%B8%80%E5%BA%A7%E5%9F%8E%E5%B8%82.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"重报深度 | “一座城市提升竞争力的重要着力点”\",\"description\":\"今年3月—8月，重庆举行了“晒文化·晒风景”(以下简称“双晒”)大型文旅推介活动，深入挖掘巴渝优秀传统文化资源和精神内涵，进一步坚定文化自信，促进文旅融合发展。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://www.cqrb.cn/content/2019-08/23/content_205657.htm\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看原文\"}}]},{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/0bbdc8b5-88db-430b-bda0-c0bd24d897cf.png?bucket=i5gmcDev&name=%E6%8E%98%E9%87%91%E8%B5%8F%E8%8A%B1%E7%BB%8F%E6%B5%8E.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/0bbdc8b5-88db-430b-bda0-c0bd24d897cf.png?bucket=i5gmcDev&name=%E6%8E%98%E9%87%91%E8%B5%8F%E8%8A%B1%E7%BB%8F%E6%B5%8E.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\" 疫情倒逼赏花游转型升级 掘金赏花经济\",\"description\":\"5月12日，酉阳叠石花谷生态扶贫示范园，游人在格桑花海中游玩。近年来，酉阳因地制宜发展乡村旅游，打造观光休闲农业，通过组织游人进农家、住山寨、购山货、吃土菜、赏山花，做活绿色自然生态旅游，带动群众增收，助力乡村振兴。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://www.cqrb.cn/content/2020-05/13/content_248040.htm\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看原文\"}}]},{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/e9b7fc38-63cd-4247-b1fa-b68fd1817e29.png?bucket=i5gmcDev&name=%E5%B7%9D%E6%B8%9D%E9%AB%98%E9%80%9F.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/25/e9b7fc38-63cd-4247-b1fa-b68fd1817e29.png?bucket=i5gmcDev&name=%E5%B7%9D%E6%B8%9D%E9%AB%98%E9%80%9F.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"交通互联互通 川渝高速路通道将达20个\",\"description\":\"重庆加快实施交通建设三年行动计划。12月29日，渝遂扩能、渝湘扩能(巴南至彭水段、彭水至酉阳段)、巫溪至开州高速公路3个交通建设项目开工，总投资达851亿元。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://www.cqrb.cn/content/2019-12/30/content_221220.htm\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看原文\"}}]}]}}}', '{\"suggestions\":[{\"reply\":{\"displayText\":\"返回首页\",\"postback\":{\"data\":\"重庆日报\"}}}]}', 2, 1, 2, 1, '2021-03-25 14:07:57', '', 60, 2, 0, 1, '{\"SMS_signature\":\"重庆日报\",\"text_content\":\"你好\",\"pic_url\":\"\",\"media_url\":\"\",\"h5_url\":\"http://14.23.86.58:8086/w/#/home?a=10682610003&t=368\"}');
