INSERT INTO `i5gmc_msg_template` VALUES (374, 2, '白云山', '', '{\"message\":{\"generalPurposeCard\":{\"layout\":{\"cardOrientation\":\"VERTICAL\",\"imageAlignment\":\"LEFT\",\"style\":\"https://5gmc.kefucloud.net/oss/download/thumbnail/255.css?bucket=i5gmcDev&name=255.css&type=null&contentType=text/css\"},\"content\":{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/26/a6dd7069-8cb7-48dc-9310-db6d04b2bf85.png?bucket=i5gmcDev&name=1616743102%281%29.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/3/26/a6dd7069-8cb7-48dc-9310-db6d04b2bf85.png?bucket=i5gmcDev&name=1616743102%281%29.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"白云山\",\"description\":\"  白云山位于广州市的东北部，为南粤名山之一，自古就有“羊城第一秀”之称。白云山山体宽阔，由30多座山峰组成，为广东最高峰九连山的支脉。面积20.98平方公里，主峰摩星岭高382米，景区内林木繁茂、峰峦重叠、溪涧纵横，登高可俯览全市，遥望珠江。每当雨后天晴或暮春时节，山间白云缭绕，蔚为奇观，白云山之名由此得来。\",\"suggestions\":[{\"reply\":{\"displayText\":\"走进白云山\",\"postback\":{\"data\":\"白云山简介\"}}},{\"reply\":{\"displayText\":\"住在白云山\",\"postback\":{\"data\":\"我要住酒店\"}}},{\"reply\":{\"displayText\":\"旅游助手\",\"postback\":{\"data\":\"旅游助手\"}}}]}}}}', '{\"suggestions\":[]}', 2, 1, 2, 1, '2021-03-26 10:03:11', '', 58, 3, 0, 0, '{\"SMS_signature\":\"\",\"text_content\":\"\",\"pic_url\":\"\",\"media_url\":\"\",\"h5_url\":\"\"}');
