INSERT INTO `i5gmc_msg_template` VALUES (384, 2, '广州天气-关于我们', '广州天气-关于我们', '{\"message\":{\"generalPurposeCard\":{\"layout\":{\"cardOrientation\":\"VERTICAL\",\"imageAlignment\":\"LEFT\",\"style\":\"https://5gmc.kefucloud.net/oss/download/thumbnail/255.css?bucket=i5gmcDev&name=255.css&type=null&contentType=text/css\"},\"content\":{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/4/29/6e0882eb-8651-409d-aeca-049cef39eb0a.png?bucket=i5gmcDev&name=%E5%85%B3%E4%BA%8E%E6%88%91%E4%BB%AC.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/4/29/6e0882eb-8651-409d-aeca-049cef39eb0a.png?bucket=i5gmcDev&name=%E5%85%B3%E4%BA%8E%E6%88%91%E4%BB%AC.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"关于我们\",\"description\":\"广州市气象局为事业单位，市正局级，实行以上级气象部门为主与市政府双重领导的管理体制，既是上级气象部门的下属单位，又是市政府主管气象工作的部门。\\n\\n市气象局设6个内设机构：办公室（与纪检监察审计室合署）、应急减灾处（预警信息管理处）、政策法规处（审批管理处）、观测预报处、计划财务处、人事教育处。市气象局下设5个直属单位：广州市气象台、广州市气候与农业气象中心（广州市灰霾监测中心）、广州市突发事件预警信息发布中心（市气象探测数据中心）、广州市防雷减灾管理办公室、广州市气象公共服务中心。\",\"suggestions\":[{\"action\":{\"urlAction\":{\"openUrl\":{\"url\":\"https://map.baidu.com/mobile/webapp/place/detail/foo=bar&qt=ninf&wd=%E6%99%AF%E7%82%B9&c=131&searchFlag=sort&center_rank=1&nb_x=12615976.33&nb_y=2616548.79&da_src=unifynearbyclick&uid=0889d6c9ba73ebdf7ec8764f&industry=&qid=&pos=&da_ref=&da_qrtp=&da_adquery=&da_adtitle=%E5%B9%BF%E5%B7%9E%E5%B8%82%E6%B0%94%E8%B1%A1%E5%B1%80&da_adindus=%E6%94%BF%E5%BA%9C%E6%9C%BA%E6%9E%84;%E8%A1%8C%E6%94%BF%E5%8D%95%E4%BD%8D&detail_from=list&vt=map\",\"application\":\"webview\",\"viewMode\":\"full\"}},\"displayText\":\"查看位置\"}},{\"action\":{\"dialerAction\":{\"dialPhoneNumber\":{\"phoneNumber\":\"020-66619588\"}},\"displayText\":\"联系我们\",\"postback\":{\"data\":\"\"}}}]}}}}', '{\"suggestions\":[{\"reply\":{\"displayText\":\"广州天气首页\",\"postback\":{\"data\":\"广州天气-首页\"}}}]}', 2, 1, 2, 1, '2021-03-2