INSERT INTO `i5gmc_msg_template` VALUES (495, 2, '驾驶建议', '', '{\"message\":{\"generalPurposeCard\":{\"layout\":{\"cardOrientation\":\"VERTICAL\",\"imageAlignment\":\"LEFT\",\"style\":\"https://5gmc.kefucloud.net/oss/download/thumbnail/255.css?bucket=i5gmcDev&name=255.css&type=null&contentType=text/css\"},\"content\":{\"media\":{\"mediaUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/4/16/9ff5caea-c5c6-46fe-91c2-26b6f5867dc1.png?bucket=i5gmcDev&name=%E7%96%B2%E5%8A%B3%E9%A9%BE%E9%A9%B6.png&type=null&contentType=image/png\",\"mediaContentType\":\"image/png\",\"thumbnailUrl\":\"https://5gmc.kefucloud.net/oss/download/0/2021/4/16/9ff5caea-c5c6-46fe-91c2-26b6f5867dc1.png?bucket=i5gmcDev&name=%E7%96%B2%E5%8A%B3%E9%A9%BE%E9%A9%B6.png&type=null&contentType=image/png\",\"thumbnailContentType\":\"image/png\",\"height\":\"SHORT_HEIGHT\"},\"title\":\"驾驶建议——疲劳驾驶\",\"description\":\"疲劳驾驶，严重时会失去对车辆的控制能力。如果仍勉强驾驶车辆，则可能导致交通事故。那么怎么预防疲劳驾驶呢?\\n\\n1、保证足够的睡眠时间和良好的睡眠效果。养成按时就寝和良好的睡眠姿势，每天保持7~8小时的睡眠；睡前1.5~2小时内不饮食，睡前1小时内不多饮水、不进行过度脑力工作；卧室内保持通风、清洁，床不宜太软，被子不要过重、过暖，枕头不宜过高。\\n\\n2、科学的安排行车时间，注意劳逸结合。科学、合理的安排行车时间和计划，注意行车途中的休息；连续驾驶时间不得超过4小时，连续行车4小时，必须停车休息20分钟以上；夜间长时间行车，应由2人轮流驾驶，交替休息，每人驾驶时间应在2~4小时之间，尽量不在深夜驾驶。\\n\\n3、注意合理的安排自己的休息方式。驾驶车辆避免长时间保持一个固定姿势，可时常调整局部疲劳部位的坐姿和深呼吸，以促进血液循环；最好在行驶一段时间后停车休息，下车活动以下腰、腿，放松全身肌肉，预防驾驶疲劳。\\n\\n4、驾驶员因疾病或其他原因服用安眠、镇痛等药物后，不可以驾驶车辆，服用药物后都会直接作用于中枢神经系统，会使人困倦、昏沉，引起嗜睡。\",\"suggestions\":[]}}}}', '{\"suggestions\":[{\"reply\":{\"displayText\":\"首页\",\"postback\":{\"data\":\"广东交通\"}}}]}', 2, 1, 2, 0, '2021-04-16 10:07:46', '', 72, 0, 0, 0, '{\"SMS_signature\":\"\",\"text_content\":\"\",\"pic_url\":\"\",\"media_url\":\"\",\"h5_url\":\"\"}');
